var cocos2dApp = cc.Application.extend({
	config: document.querySelector("#cocos2d-html5")["c"],
	ctor: function(scene) {
		this._super();
		this.startScene = scene;
		cc.COCOS2D_DEBUG = this.config["COCOS2D_DEBUG"];
		BTG.calculateCanvasSize();
		cc.setup(this.config["tag"]);
		cc.AudioEngine.getInstance().init("mp3,ogg");
		cc.Loader.shareLoader().onloading = function() {
			//cc.LoaderScene.shareLoader().draw();
			cc.GameLoaderScene.shareLoaderScene().draw();
		};
		cc.Loader.shareLoader().onload = function() {
			cc.AppController.shareAppController().didFinishLaunchingWithOptions();
		};
		cc.Loader.shareLoader().preload(g_ressources);
	},
	applicationDidFinishLaunching: function() {
		var director = cc.Director.getInstance();
		director.setDisplayStats(this.config["showFPS"]);
		director.setAnimationInterval(1.0 / this.config["frameRate"]);
		director.runWithScene(new this.startScene());
		return true;
	}
});
var rpgApp = new cocos2dApp(BTG.RPGGameScene);

cc.GameLoaderScene = cc.Class.extend( /**  @lends cc.LoaderScene# */ {
    _logo: new Image(),
    _logoCocos: new Image(),

    /**
     * Constructor
     */
    ctor: function () {
        this._logoCocos.src = "data:image/jpeg;base64,";
        this._logoCocos.width = 160;
        this._logoCocos.height = 200;
        this._logo.src = "data:image/png;base64,";
    },

    /**
     * Draw loading screen
     */
    draw: function () {
        var logoWidth = (cc.canvas.width - this._logo.width) / 2;
        var logoHeight = (cc.canvas.height - this._logo.height) / 2;
        cc.renderContext.clearRect(0, -cc.canvas.height, cc.canvas.width, cc.canvas.height);
        cc.renderContext.fillStyle = "#202020";
        cc.renderContext.fillRect(0, -cc.canvas.height, cc.canvas.width, cc.canvas.height);
        cc.drawingUtil.drawImage(this._logo, cc.p(logoWidth - 150, logoHeight));
        cc.drawingUtil.drawImage(this._logoCocos, cc.p(logoWidth + 140, logoHeight));
        cc.renderContext.fillStyle = "#b2b4b3";
        cc.renderContext.font = 'Bold 12px Verdana';
        cc.renderContext.textAlign = 'left';
        cc.drawingUtil.fillText("Loading " + cc.Loader.shareLoader().getProgressBar() + "%", logoWidth + 30, logoHeight - 15);
    }
});

/**
 * Shared loader scene
 * @return {cc.LoaderScene}
 */
cc.GameLoaderScene.shareLoaderScene = function () {
    if (!cc.shareLoaderScene) {
        cc.shareLoaderScene = new cc.GameLoaderScene();
    }
    return cc.shareLoaderScene;
};